Description:
Mình có cấu trúc dữ liệu như sau 
public class Sku 
{ 
 public int Id { get; set; } 
 public int ProductId { get; set; } 
 public string Name { get; set; } 
 public List<SkuDetail> SkuDetails { get; set; }; 
} 
public class SkuDetail 
{ 
 public int Id { get; set; } 
 public int SkuId { get; set; } 
 public string Name { get; set; } 
} 
Dữ liệu đầu vào mẫu 
var skus = new List<Sku>(); 
skus.Add(new Sku 
{ 
 Name = "Size", 
 SkuDetails = new List<SkuDetail> 
 { 
 new SkuDetail {Name = "S"}, new SkuDetail {Name = "M"}, 
 new SkuDetail {Name = "L"}, new SkuDetail {Name = "XL"}, new SkuDetail {Name = "XXL"} 
 } 
}); 
skus.Add(new Sku 
{ 
 Name = "Color", 
 SkuDetails = new List<SkuDetail> 
 { 
 new SkuDetail {Name = "Red"}, new SkuDetail {Name = "White"}, 
 new SkuDetail {Name = "Black"} 
 } 
}); 
skus.Add(new Sku 
{ 
 Name = "Style", 
 SkuDetails = new List<SkuDetail> 
 {new SkuDetail {Name = "Modern"}, new SkuDetail {Name = "classic"}} 
}); 
Mình cần tính và tìm toàn bộ tổ hợp của sku và skudetail 
Ví dụ đầu ra: 
Size=S, Color=Black, Style=classic 
Size=L, Color=Red, Style=classic 
Size=S, Color=Red, Style=Modern 
.... v.v 
Với dữ liệu demo trên thì sẽ có 30 tổ hợp của sku và skuDetail 
Để hiểu rõ hơn, giống như việc mua hàng online, khi bạn mua chọn 01 sản phẩm giày chẳng hạn, thì bạn cần chọn màu, size giày, chất liệu .v.v.. 
Thì mỗi sự lựa chọn đó là một tổ hợp của sku và skuDetail
